import { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import GetExternalData from "./components/GetExternalData";

const  App = () =>  {
  const temp: any = [];
  const [tableData, setTableData] = useState(temp);

  const getData = () => {
    const [data, isLoading] = GetExternalData({
      link: "http://algotraders.pythonanywhere.com/webDev/",
    });
    if (isLoading) {
      setTableData([]);
    } else {
      setTableData(data);
    }
  };

  return (
    <div className="App">
      <button onClick={() => getData()}>Load Data</button>
      <table>
        {tableData.length === 0 ? (
          <div>Loading</div>
        ) : (
          tableData.Matrix.map((dataArray: any, i: number) => {
            return (
              <tr>
                {dataArray.map((number: number, j: number) => {
                  return (
                    <td>
                      {(
                        number / tableData.constant
                      ).toPrecision(2)}
                    </td>
                  );
                })}
              </tr>
            );
          })
        )}
      </table>
    </div>
  );
}

export default App;
